10|Go的继承
​    是否支持继承是判断一门语言是否是面向对象编程的重要标准，这也是Go语言是否属于一门面向对象编程语言的争议所在，下面来看一段代码来说明为什么说Go是也不是面向对象的编程语言
​    就第二种"继承"方式来看，虽然能够自动拥有父类的方法，但是通过例子可以看出，即使重载了子类的Speak()方法，在调用Speakto()方法时依然打印了父类中的内容，这根传统意义上的继承是有区别的。
​    也可以发现，Go是不支持LSP特性的。所以说Go并不是传统意义上的继承，称之为为组合更加贴切
package main

import "fmt"

type Pet struct {

}

func (p *Pet) Speak(){
    fmt.Println("...")
}

func (p *Pet) Speakto(){
    p.Speak()
    fmt.Println("web")
}
//第一种方式,缺点是并不能自动继承方法，还需要手动声明一遍
type Cat struct {
    p *Pet
}

func (c *Cat) Speak(){
    c.p.Speak()
}

func (c *Cat) Speakto(){
    c.p.Speakto()
}

//第二种方式,可以不用每个函数再声明一遍了
type Dog struct{
    *Pet
}
//方法重载
func (d *Dog) Speak(){
    fmt.Println("wang-wang-wang")
}

func main(){
    p1 := new(Pet)
    p1.Speakto()    //... web

    d1 := new(Dog)
    d1.Speakto()    //... web

    c1 := new(Cat)
    c1.Speakto()    //... web

