Demo程序功能概述

服务器端存在Test_service类中定义了my_function方法，客户端通过gRPC协议进行远程调用；该方法实现的功能是将接受到的字符串内容全部改为大写并返回

PB接口描述文件定义
syntax = "proto3";
package data;

#定义数据结构
message Data{
    string text=1;
}

#定义服务接口，即声明我要调用目标服务器上的哪个函数
service Test_service{
    #定义调用函数名称、参数类型与返回数据类型
    rpc my_function(Data) returns (Data) {}
}

